func shortestBeautifulSubstring(s string, k int) string {
    shortest, count, start := "", 0, 0
    for i := range s {
        if s[i] == '1' {
            count++
        }
        if count == k {
            for s[start] != '1' {
                start++
            }
            if len(shortest) == 0 || i-start+1 < len(shortest) {
                shortest = s[start : i+1]
            }
            start++
            count--
        }
    }
    // Find lexicographically smallest substring by scanning the shortest ones
    for i := 0; i <= len(s)-len(shortest); i++ {
        sub := s[i : i+len(shortest)]
        ones := 0
        for j := 0; j < len(sub); j++ {
            if sub[j] == '1' {
                ones++
            }
        }
        if ones == k && (shortest == "" || sub < shortest) {
            shortest = sub
        }
    }
    return shortest
}
